$(document).ready(function () {
  $(".menu").on("click", "a", function (event) {
    event.preventDefault();
    var id = $(this).attr('href');
    var top = $(id).offset().top - 50;
    $('body,html').animate({ scrollTop: top }, 1500);

  });
  $(".up-button").on("click", function (event) {
    event.preventDefault();
    $('body,html').animate({ scrollTop: 0 }, 1500);

  });
  $('.more').on('click', function () {
    $('.more_contact').css({
      "display": "inline-block"
    });;
    return false;
  });

  $(".order_button").click(function (event) {
    $(".advert").addClass('open active');
    var madalpScrollTo = $(window).scrollTop();
    window.onscroll = function () { window.scrollTo(0, madalpScrollTo); };

  });
  $(".partner_button").click(function (event) {
    $(".partner").addClass('open active');
    var madalpScrollTo = $(window).scrollTop();
    window.onscroll = function () { window.scrollTo(0, madalpScrollTo); };

  });


  $(".icon-close").click(function () {
    $(".popup").parent().removeClass('active');
    $(".popup").parent().removeClass('open');
    $(".popup_first").show();
    $(".popup_last").hide();
    var madalpScrollTo = $(window).scrollTop();
    window.onscroll = function () { };
  });

  $('.input_field').focus(function () {
    $(this).parent().animate().addClass('input_active');
  });
  $('.input_field').blur(function () {
    if ($(this).val() == '') {
      $(this).parent().animate().removeClass('input_active');
    }

  });
  //first-backgroud
  $(function () {
    $(window).scroll(function (e) {
      parallax();
    });
    function parallax() {
      var scrolled = $(window).scrollTop();

      var elemTop = scrolled * 0.4;
      $('.tagline').animate({
        marginTop: elemTop + 'px'
      }, 0.1);
    }
  });


});
//fixed-button
$(window).scroll(changeFixedButton);

function changeFixedButton() {
  let tempScrollTop = $(window).scrollTop();
  let firstHeight = $('.first_background').height();
  let secondHeight = $('.second_background').height() - 320;
  let summFirstSecondBack = firstHeight + secondHeight;
  // let thridHeight = $('.thrid_background').height();
  // let separatorHeight = $('.separator').height();
  // let summThridSepar = thridHeight + separatorHeight;
  console.log(summFirstSecondBack);
  if (tempScrollTop >= summFirstSecondBack && tempScrollTop <= 2650 || tempScrollTop >= 3450 && tempScrollTop <= 7155) {
    $('#fixed-button').css({
      "color": "#6d4493",
      "border-color": "#6d4493"
    });
    $('#fixed-button').addClass('purple_line');
  } else {
    $('#fixed-button').css({
      "color": "#ffffff",
      "border-color": "#ffffff"
    });
    $('#fixed-button').removeClass('purple_line');
  }

};
//up-button
$(window).scroll(changeUpButton);
function changeUpButton() {
  let tempScrollTop = $(window).scrollTop();
  if (tempScrollTop > 580) {
    $('.up-button').fadeIn();
  } else {
    $('.up-button').fadeOut();
  }
};
